class Solution:
    def minNumberOfFrogs(self, croakOfFrogs: str) -> int:
        target='croak'
        index_dict={}
        count=0
        current_count=0
        for i in range(len(croakOfFrogs)):
            char = croakOfFrogs[i]
            count=max(count,current_count)
            # for index in index_dict:
            #     current_count+=index_dict[index]
            if char=='c':
                index_dict[1]=index_dict.get(1,0)+1
                current_count+=1
            else:
                index = target.index(char)
                index_count = index_dict.get(index,0)
                if index_count==0:
                    return -1
                else:
                    index_dict[index]=index_count-1
                    if char!='k':
                        index_dict[index+1] = index_dict.get(index+1, 0) + 1
                    else:
                        current_count-=1
        if current_count>0:
            return -1
        return count
s = Solution()
